const Users = () => { 
    const data = [
        { id: 1, name: "John Doe" }, 
       { id: 2, name: "Victor Wayne" }, 
       { id: 3, name: "Jane Doe" }
    ]; 
    return data.map((user) => (<span>{user.name}</span>))
  
};
export default Users;
